const state = [[0, 0, 0], [0, 0, 0], [0, 0, 0]];
let theplayer;

function check() {
    let isGameOver = false;
    // Cek per baris
    for (let i = 0; i < state.length; i++) {
        const harusnya = state[i][0];
        if(harusnya == 0) {continue;}
        isGameOver = true;
        for (let j = 0; j < state.length; j++) {
            const now = state[i][j];
            if(now != harusnya) {isGameOver = false; break ;}
        }
        if(isGameOver) {return harusnya;}
    }

    // Cek per kolom
    for (let j = 0; j < state.length; j++) {
        const harusnya = state[0][j];
        if(harusnya == 0) {continue;}
        isGameOver = true;
        for (let i = 0; i < state.length; i++) {
            const now = state[i][j];
            if(now != harusnya) {isGameOver = false; break ;}
        }
        if(isGameOver) {return harusnya;}
    }

    // Cek diagonal
    const harusnya1 = state[0][0];
    isGameOver = true;
    for (let i = 0; i < state.length; i++) {
        if(harusnya1 == 0) {isGameOver = false; break;}
        const now = state[i][i];
        if(now != harusnya1) {isGameOver = false; break ;}
    }
    if(isGameOver) {return harusnya1;}

    // Cek diagonal2
    const harusnya2 = state[0][2];
    isGameOver = true;
    for (let i = 0; i < state.length; i++) {
        if(harusnya2 == 0) {isGameOver = false; break;}
        const now = state[i][state.length-1-i];
        if(now != harusnya2) {isGameOver = false; break ;}
    }
    if(isGameOver) {return harusnya2;}

    return 0;
}

function hitungGerakan() {
    let out = 0;
    for (let i = 0; i < state.length; i++) {
        for (let j = 0; j < state.length; j++) {
            if(state[i][j] !== 0) {out++;}
        }
    }
    return out;
}

function trans(arr) {
    const str = JSON.stringify(arr.flat());
    return str.slice(1, str.length-1);
}

function loop() {
    // Update state
    for (let i = 0; i < state.length; i++) {
        for (let j = 0; j < state.length; j++) {
            const x = getComputedStyle(document.querySelector(`td[data-row="${i}"][data-col="${j}"] [aria-label="X"]`)).display == "none";
            const o = getComputedStyle(document.querySelector(`td[data-row="${i}"][data-col="${j}"] [aria-label="O"]`)).display == "none";

            if(x && o) {state[i][j] = 0;}
            else if(x && !o) {state[i][j] = -1;}
            else {state[i][j] = 1;}
        }
    }

    if(check() !== 0 || hitungGerakan() === 9) {return ;}
    const now = (hitungGerakan()%2)?-1:1;
    if(now === theplayer) {
        const next = whatToMove[trans(state)];
        document.querySelector(`td[data-row="${next[0]}"][data-col="${next[1]}"]`).click();
    }
    window.requestAnimationFrame(loop);
}

function startGame(player) {
    theplayer = player;
    loop();
}